import React, { Component } from 'react'

export class Input extends Component {
    constructor(props) {
        super(props)
    
        this.refToParent=this.props.ref;
    }
    
   
    render() {
        return (
            <div>
               <button onClick={this.ChangeParentFocus} ></button>
            </div>
        )
    }
}

export default Input
